window.bookSummaryJSON = "<p>At 15, Alexis Carew has to face an age old problem - she's a girl, and only a boy can inherit the family's vast holdings. Her options are few. She must marry and watch a stranger run the lands, or become a penniless tenant and see the lands she so dearly loves sold off. Yet there may be another option, one that involves becoming a midshipman on a shorthanded spaceship with no other females.</p>"; 
